import React from 'react';
import Sdata from './Sdata';
import Card from './Card';


const Netflix = () => {
    return(
        Sdata.map((val) =>{
            return(
                <Card 
                key={val.id}
                sname={val.sname}
                imgsrc={val.imgsrc}
                title={val.title}
                link={val.links}
                />
            );
        }).filter((elem) => {
            return(
                elem.title === 'Netflix Original Series'
            );
        })
    );
}


export default Netflix;
